import { Link } from 'react-router-dom'
import React from 'react';
import NotFound404 from '../components/pages/page_404';

const NoMatch = () => {
  return (
    <center>
      <NotFound />

      <Link to="/" className="btn btn-primary">
        Retour sur la page principale
      </Link>
    </center>
  );
};

export default NoMatch;
